import React, { Component } from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import { Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";


export class Header extends Component {
  render() {
    return (

      <Container className="container-fluid bg">
          <div className="navvv">
            <ul>
              <Link className="a" to="/">
                <li className="navv">Home</li>
              </Link>
              <Link className="b" to="/Culture.js">
                <li className="navv">Culture</li>
              </Link>
              <Link className="c" to="/Sales.js">
                <li className="navv">Sales / Promotion</li>
              </Link>
              <Link className="d" to="/About.js">
                <li className="navv">About</li>
              </Link>
            </ul>
          </div>

          <div className="logo">

            9JADIASPORA.
            <div className="anime"></div>
          </div>
        </Container>



    );
  }
}

export default Header;
